import React from 'react'

export default function Header() {
    return (
        <div className="header-wrapper">
        <div className="text-wrapper">
            <p><span className="dash">---</span><span>Your</span><span className="text-center">Personal</span><span className="text-between">Recipes</span><span className="dash">---</span></p>

        </div>
        <div className="text-sub"><span>Manage your own recipe collections</span></div>



        </div>
    )
}
